import React, { useEffect, useState } from 'react';
import Board from './components/Board';
import { connectWebSocket, sendMoveCommand } from './websocket';

function App() {
    const [messages, setMessages] = useState([]);

    useEffect(() => {
        const { disconnect } = connectWebSocket((message) => {
            console.log('Received message:', message);
            setMessages((prevMessages) => [...prevMessages, message.body]);
        });

        return () => {
            disconnect();
        };
    }, []);

    const handleMove = (move) => {
        console.log('Sending move:', move);
        sendMoveCommand(move);
    };

    return (
        <div>
            <h1>WebSocket App</h1>
            {/* Render the Board component if needed */}
            <Board /> 
            <button onClick={() => handleMove({ x: 1, y: 2 })}>Send Move</button>
            <div>
                <h2>Messages:</h2>
                <ul>
                    {messages.map((msg, index) => (
                        <li key={index}>{msg}</li>
                    ))}
                </ul>
            </div>
        </div>
    );
}

export default App;
